import useFetch from "../hooks/useFetch";
import DeleteProjectList from "../components/DeleteProjectList";
import { useAuthContext } from "../hooks/useAuthContext"

const Delete = () => {
    const {data: projects, isPending, errorMessage} = useFetch('api/projects');
    const { user } = useAuthContext();

    if(!user) {
        navigate('/login')
    }
    return (  
        <div className="deleteProject">
            <h2>Delete A Project</h2>
            {errorMessage && <div>{errorMessage}</div>}
            {isPending && <div>Loading...</div>}
            {projects && <DeleteProjectList projects={projects} />}
        </div>

    );
}

export default Delete;
